import React from 'react';
import { StatusBar, SafeAreaView, StyleSheet, Button, Alert, View } from 'react-native';
import Cesta from './src/telas/Cesta';

export default function App(){
  return(
    <SafeAreaView>
        <StatusBar />
        <Cesta></Cesta>
        <Button style={style.btn}
          title="Entrar"
          //onPress={ () => Alert.alert('Usúario não Encontrado')}
        ></Button>
      <View style={style.input}></View>
    </SafeAreaView>
  );
}

const style = StyleSheet.create({
  btn:{
      height: 50,
      width: '90%',
      marginLeft: 20,
      borderRadius: 5,
      backgroundColor: 'red'
  },
  container: {
      flex:1,
      width: '80%',
      justifyContent: 'center',
      alignItems: 'center',
      alignContent: 'center',
  },
  input: {
      width: '90%',
      height: 50,
      backgroundColor: '#DDD',
      borderRadius: 5,
      fontSize: 20,
      padding: 15,
      marginTop: 10,
      marginLeft: 20,
      color: 'red',
      fontSize: 20,
      fontWeight: 'bold'
  }
})
